ERROR - 2025-01-03 19:09:45 --> Query error: ERROR:  invalid byte sequence for encoding "UTF8": 0xde 0x6e - Invalid query: INSERT INTO "sm_cppt" ("id_layanan_pendaftaran", "waktu", "id_profesi", "subject", "objective", "assessment", "plan", "ademi_assesment", "ademi_diag", "ademi_interv", "ademi_monev", "sbar_situation", "sbar_background", "sbar_assesment", "sbar_recommend", "id_nadis", "ttd_nadis", "instruksi_ppa", "id_dokter_dpjp", "id_user", "konsul_via_telp", "konsul", "created_date") VALUES ('663272', '2025-01-03 18:54', '18', 'Pasien mengatakan demam naik turun disertai mual dan muntah frekuensi 4x/hari, pasien belum bab selama 3 minggu, terdapat benjolan pada perut kiri, pasien tidak menyadari adanya benjolan dan tidak terasa nyeri. ', 'Kesadaran CM, GCS 15 E4 V5 M6, EWS hijau 2, ADL di bantu sebagian, Pasien tampak lemas, terdapat bejolan di perut kiri, makan  porsi, mual + muntah  . Pasien belum bab 3 minggu. TD: 143/96 mmhg, nadi 76 x/m, suhu: 36.4 C RR 24x/m, saturasi 98ngan nk 4lpm. IVFD RL 1000cc per 24 jam, Pasien riwayat HT dengan Amlodipin 1x5mg. (3/1/24) Ro thorax Suspek kardiomegali dengan aorta kalsifikasi Bercak opasitas noduler berbagai ukuran di kedua lapangan paru, DD/ metastasis, pneumonia (masih mungkin TB). Hemoglobin 4.8 , Hematokrit 17, Leukosit 17.1 , Trombosit 518rb , GDS : 282. Cek ur/cr, HBsAg, SGOT/SGPT tgg hasil.', 'Perfusi perifer tidak efektif, konstipasi, HIpertermia', '', '', '', '', '', '', '', '', '', '2008', '1', '&nbsp;Transfusi PRC 2 labu <div>CT scan abdomen dengan kontras tgg jadwal</div><div>cek hba1c besok. </div><div>DR 2 hari lagi. </div><div>Cek GDS per hari. </div><div>Monitor TNRS io.</div>', NULL, '2008', 0, NULL, '2025-01-03 19:09:45')
